import { Container, Heading, HStack, Stack } from "@chakra-ui/react";

function NavBar() {
  return (
    <Stack
      w="100%"
      py="6"
      background="white"
      direction="row"
      justify="space-between"
      fontSize="lg"
      maxW="3xl"
    >
      <HStack spacing="4">
        <HStack pr="4">
          <Heading size="md">Solana - Explorer</Heading>
        </HStack>
      </HStack>
    </Stack>
  );
}

export default NavBar;
